Company About:
Directeur de la Caisse des écoles du 19e.

La Caisse des Écoles du 19e est un établissement public qui assure le service de restauration scolaire :

- des 74 écoles maternelles et élémentaires publiques de l'arrondissement;
- des collèges Mozart, Claude Chappe / Ida Grinspan, Georges Brassens, Sonia Delaunay, Suzanne Lacore, Charles Péguy, Georges Rouault;
- du lycée Armand Carrel;
- de la cantine de la Mairie du 19e;
- des jardins d'enfant Alphonse Karr, Solidarité, Ambroise Rendu, Pré Saint-Gervais;
- des centres de loisirs du 19e.

Qui prépare les repas ?

Les repas sont préparés par nos équipes en cuisine, sous la responsabilité de nos chefs cuisiniers, avec deux modes de préparation :

En cuisine centrale : nous préparons 8 700 repas/jour. La cuisine centrale est en liaison froide, c'est à dire qu'elle livre directement les repas cuisinés dans des cuisines dites \"satellites\" de certaines écoles et collèges de l'arrondissement. Celles-ci s'occupent alors de la remise en température et du service.
En cuisines traditionnelles : 12 cuisines préparent sur place les repas pour un total de 5 200 repas/jour. Quatre de ces cuisines livrent en liaison chaude des repas aux écoles à proximité.

Qui élabore les menus ?

Les menus sont les mêmes partout, conçus sous le contrôle d'une diététicienne, en respectant la norme alimentaire des 4 composantes, notamment définis par :

- les recommandations nutritionnelles du GEMRCN (Groupement d'Étude des Marchés en Restauration Collective et de Nutrition) ;
- l'arrêté du 30 septembre 2011 sur la qualité nutritionnelle des repas servis dans le cadre de la restauration scolaire.

